\b0 \ This allows the user to search for an any individual in the ChMS.\ \ Each individual can be a membership status of type:\ \'95 Member\ \'95 Non-Member/Tithe\ \'95 ?\ \'95 ?\ \ To Confirm: Membership Status is based on the individual and \i not \i0 the household. So it is possible to have a household where one is a member and the other one is a non-member/tithe.\ \ \ \ \ Columns can be sorted by any column in either ascending or descending order. By default, it is sorted by Last Name in ascending order.\ \ \ \ \ \ Clicking any First or Last name for an individual will take the user to \b Screen 2.2 \b0 for that individual.}

