\f0\b\fs18 \cf0 View Groups \'96 Example for Worship Arts\
\b0 \ Groups provide the ability to organize individuals into groups or organizational units. Groups can either be for specific tasks or events (e.g. "Worship Team", "Marriage Retreat 2010 Attendee", etc.), or they can be a ministry in and of itself (e.g. "OASIS", "Real World", etc.).\ \ Groups must belong to at least one or more ministry which oversees the management of the group.\ \ Groups can have an email alias (e.g. \ul realworld@groups.alcf.net\ulnone ) as well as one or more individuals (e.g. staff member, lay leader, etc.) who moderates and manages the email alias. Email options for each group can be one of the following:\ * \b Announce Only \b0 \'96 only moderators and users affiliated with this ministry is allowed to send messages to this list\ * \b Private List \b0 \'96 only members of the group can send messages to the list\ * \b Public List \b0 \'96 anyone can send messages to the list\ \ These are the following "Types" of groups:\ * \b Ad Hoc \b0 \'96 these are self-service groups that need to be further-defined.\ * \b Category \b0 \'96 see below for more information\ * \b Growth \b0 \'96 these are Growth Groups, which has a host, a facilitator, and a structure type (e.g. Young Adult, Regular, Spanish Speaking, etc.)\ * \b Regular \b0 \'96 these groups are for everything else\ * \b Smart \b0 \'96 these groups cannot have individuals manually added or removed to it, but instead its membership is defined by rules (e.g. "any individual who is listed as a facilitator of a Growth Group")\ \ To help with the organization of groups, groups can have a category, and categories can be nested. Note that categories, in and of themselves, cannot have individual members assigned to it. However, categories can also have email aliases (e.g. \ul safarikids@groups.alcf.net\ulnone ) where the message would be sent out to the distinct set of individuals who are part of any group that belongs to the "Safari Kids" category.\ \ Normally, any groups that an individual is part of will be listed in the individual's profile page on \b Screen 2.4.1 \b0 . However, if a specific group is marked as "Confidential", the individual's membership will NOT be made known to any user not affiliated with the ministry that the group is part of.\ \ Any logged-in user can view the membership of any non-confidential group. For confidential groups, only users affiliated with the ministry of that group can view the membership. \ \ Only users affiliated with the ministry of a group can edit the membership, name, categorization and other properties of a given group.}

